const CACHES_NAME='assets-v11',CACHES=['/index.html','/js/main.js','/css/styles.css','/img_src/1.jpg','/img_src/2.jpg','/img_src/3.jpg','/img_src/4.jpg','/img_src/5.jpg','/img_src/6.jpg','/img_src/7.jpg','/img_src/8.jpg','/img_src/9.jpg','/img_src/10.jpg','/img_src/heart-empty.svg','/img_src/heart-full.svg','/img_src/rr.svg','/img_src/triangle.svg'];self.addEventListener('activate',function(a){a.waitUntil(caches.keys().then(function(b){return Promise.all(b.filter(function(c){return c.startsWith('assets-')&&!CACHES.includes(c)}).map(function(c){return caches['delete'](c)}))}))}),self.addEventListener('install',function(a){console.log('installing..'),a.waitUntil(caches.open(CACHES_NAME).then(function(b){return b.addAll(CACHES)}))}),self.addEventListener('fetch',function(a){a.respondWith(caches.open(CACHES_NAME).then(function(b){return b.match(a.request).then(function(c){return fetch(a.request).then(function(d){if('GET'==a.request.method)return b.put(a.request,d.clone()),d}).catch(function(){return c})})}))});